.button {
  background-color: aqua;
  border: none;
  padding: 10px 10px;
  text-align: center;
  border-radius: 16px;
  text-decoration: none;
  display: inline-block;
  font-size: 16px;
  margin: 4px 2px;
  cursor: default;
  text-shadow: 4px 4px 4px #000;
}

html {
  scroll-behavior: smooth;
}

h1 {
  font-family: 'Trebuchet MS','Cambria', 'Cochin', 'Georgia', 'Times New Roman', 'Times', 'serif';
}

h3,
h4,
h5 {
  font-family: "Roboto";
}

h2 {
  font-style: italic;
  font-family: 'Gill Sans', 'Gill Sans MT', 'Calibri', 'Trebuchet MS', 'sans-serif';
  font-weight: bolder;
  display: block;
}

h6 {
  font-family: "Sans-serif"
}

body {
  font-family: "Source Sans Pro"
}

.myBtn {
  display: none;
  position: fixed;
  bottom: 20px;
  left: 50%;
  transform: translateX(-50%);
  background-color: aqua;
  z-index: 99;
  border: none;
  outline: none;
  padding: 10px;
  border-radius: 16px;
}

.myBtn:hover {
  background-color: #00ced1;
}

table,
th,
td {
  border: 1px solid black;
}

hr {
  height: 3px;
  border-width: 0;
  background-color: #00FFFF;
}

#p1 {
  text-align: left;
}

#Services {
  padding: 10px;
  text-align: center;
}

details>summary {
  list-style: none;
}

summary::-webkit-details-marker {
  display: none
}

summary::after {
  content: ' 汨';
  font-size: 2.5rem;

}

details[open] summary:after {
  content: " 笘晢ｸ十

